import '../styles/Movies.css';
import {useState} from "react";
function Movies() {
    const date = new Date();
    const currentDate = date.toJSON();
    const [datePickerValue, setDatePickerValue] = useState(currentDate);
    const currentDateWithoutTime = currentDate.split("T")[0];
    return (
        <div className="movie-repertoire">
            <h1>Repertoire For {datePickerValue}</h1>
            <input type="date" id="date-picker" name="date-picker" value="2025-01-16"></input>
        </div>
    );
}

export default Movies;
